The ark-ec library allows you to work both with affine and projective coordinates and to easily switch between them. For short Weierstrass curves, the affine representation corresponds to the GroupAffine struct implementing the AffineCurve trait: pub struct GroupAffine<P: Parameters> { pub x: P::BaseField, pub y: P::BaseField, pub infinity: bool, // some fields omitted
} The projective representation uses Jacobian (not homogeneous) coordinates and corresponds to the GroupProjective struct implementing the ProjectiveCurve trait: pub struct GroupProjective<P: Parameters> { pub x: P::BaseField, pub y: P::BaseField, pub z: P::BaseField, // some fields omitted
} Note in particular how the GroupAffine struct needs to hold a boolean field infinity indicating whether an instance is the point at infinity or not, whereas GroupProjective needs not. The trait Parameters, an alias for ark_ec::models::SWModelParameters , contains all parameters specifying a prime-order subgroup of an elliptic curve in short Weierstrass form: pub trait SWModelParameters: ModelParameters { const COEFF_A: Self::BaseField; const COEFF_B: Self::BaseField; const COFACTOR: &'static [u64]; const COFACTOR_INV: Self::ScalarField; const AFFINE_GENERATOR_COEFFS: (Self::BaseField, Self::BaseField); fn mul_by_a(elem: &Self::BaseField) -> Self::BaseField { ... } fn add_b(elem: &Self::BaseField) -> Self::BaseField { ... }
} What about types G1Affine and G2Affine? Recall that in order to define a pairing one needs two prime-order subgroups G1​ and G2​ of elliptic curves defined on respectively Fp​ and some field extension Fpm​. Types G1Affine and G2Affine correspond to the affine representation of these two subgroups and are defined for curves of the BLS-12 family respectively here and there as: type G1Affine<P> = GroupAffine<<P as Bls12Parameters>::G1Parameters>;
type G2Affine<P> = GroupAffine<<P as Bls12Parameters>::G2Parameters>; Type P must implement the Bls12Parameters trait: pub trait Bls12Parameters: 'static { type Fp: PrimeField + SquareRootField + Into<<Self::Fp as PrimeField>::BigInt>; type Fp2Params: Fp2Parameters<Fp = Self::Fp>; type Fp6Params: Fp6Parameters<Fp2Params = Self::Fp2Params>; type Fp12Params: Fp12Parameters<Fp6Params = Self::Fp6Params>; type G1Parameters: SWModelParameters<BaseField = Self::Fp>; type G2Parameters: SWModelParameters<BaseField = Fp2<Self::Fp2Params>, ScalarField = <Self::G1Parameters as ModelParameters>::ScalarField>; const X: &'static [u64]; const X_IS_NEGATIVE: bool; const TWIST_TYPE: TwistType;
} As expected, types G1Parameters and G2Parameters must both implement the SWModelParameters trait with a prime base field for G1Parameters and a quadratic extension field for G2Parameters.

