Conversion between affine and projective coordinates is handled by the From and Into traits. These are very general and useful traits that you can read about here and here . They provide respectively an associated function from and a method into, the latter one being generally derived from the former. The function from for creating a point in projective coordinates from a point in affine coordinates is implemented here : impl<P: Parameters> From<GroupAffine<P>> for GroupProjective<P> { #[inline] fn from(p: GroupAffine<P>) -> GroupProjective<P> { if p.is_zero() { Self::zero() } else { Self::new(p.x, p.y, P::BaseField::one()) } }
} The converse function, creating a point in affine coordinates from a point in projective coordinates, is implemented here : impl<P: Parameters> From<GroupProjective<P>> for GroupAffine<P> { #[inline] fn from(p: GroupProjective<P>) -> GroupAffine<P> { if p.is_zero() { GroupAffine::zero() } else if p.z.is_one() { // If Z is one, the point is already normalized. GroupAffine::new(p.x, p.y, false) } else { // Z is nonzero, so it must have an inverse in a field. let zinv = p.z.inverse().unwrap(); let zinv_squared = zinv.square(); // X/Z^2 let x = p.x * &zinv_squared; // Y/Z^3 let y = p.y * &(zinv_squared * &zinv); GroupAffine::new(x, y, false) } }
} Note that there are also more explicit into_affine and into_projective methods which simply call into. All what we just said was for version 0.3 of the crate. The structs and traits have been renamed in version 0.4 as follows: struct GroupAffine → Affine trait AffineCurve → AffineRepr struct GroupProjective → Projective trait ProjectiveCurve → CurveGroup: Group. Hopefully the code of the verify function should now make completely sense. Note in particular how elliptic curve points are converted from affine coordinates to projective coordinates using method into before being passed to product_of_pairings. It's now time to see what the hash_to_curve function does exactly. Note that hyphens are not valid characters in Rust identifiers, however it is possible (and idiomatic) to use them in package and crate names. Cargo automatically converts them to underscores. See here . If you're curious about what guarantees we have that the source codes on github.com and crates.io are really the same, I recommend this interesting blog post by Eric Seppanen.

